import React, { useState,useEffect } from 'react';
import style from './Video2.module.css';

const Video2 = () => {
    const [VideoContainer, setVideoContainer] = useState(false);
    const [VideoSize, setVideoSize] = useState(false);


    const operation = () =>{
        setVideoContainer(!VideoContainer);
        setVideoSize(!VideoSize);
        console.log('sefse');
      } 
      useEffect(() => {
        const containerClassName = VideoContainer ? style.new__video_container : style.video_container;
        const videoClassName = VideoSize ? style.new__video_container__video : style.video_container__video;

        const videoElement = document.getElementById('video-element');
        if (videoElement) {
          videoElement.className = videoClassName;
        }

        const containerElement = document.getElementById('container-element');
        if (containerElement) {
          containerElement.className = containerClassName;
        }
      }, [VideoContainer, VideoSize]);


    return (

    <div className={VideoContainer ? style.new__video_container :style.video_container}>
          <video 
            className={VideoSize? style.new__video_container__video:style.video_container__video}
            onMouseEnter={operation}
            onMouseLeave={operation}
            src="/videos/main2.mp4"
            autoPlay
            loop
            muted
          />
      </div>
    );
  };

export default Video2;
